        className="p-3 w-full md:w-[180px] rounded bg-white text-black"
      />

      <input
        type="date"
        className="p-3 w-full md:w-[180px] rounded bg-white text-black"
      />

      <button className="bg-blue-600 hover:bg-blue-700 text-white font-semibold px-6 py-3 rounded">
        Search
      </button>
    </div>
  </div>
</div>

  );
